import React, { Component } from 'react'

export default class Tab extends Component {
    onClick = (event) =>{
        this.props.activate(this.props.key)
    }
    render() {
        return (
            <a onClick={this.onClick}  className={this.props.active}>
                {this.props.name}
            </a>
        )
    }
}
